import React from 'react'
import { Button, Col, Row } from "react-bootstrap";
import { Formik, Field, Form } from "formik";

const Add_services = () => {

  const labelStyle = {
    marginBottom: "8px",
    fontSize: "14px",
    fontWeight: "bold",
  };

  const inputStyle = {
    padding: "10px",
    marginBottom: "20px",
    width: "100%",
    border: "1px solid #ccc",
    borderRadius: "4px",
    fontSize: "16px",
  };

  const buttonStyle = {
    padding: "10px 30px",
    backgroundColor: "#007bff",
    color: "#fff",
    border: "none",
    borderRadius: "4px",
    fontSize: "16px",
    cursor: "pointer",
    align: "right",
  };

  const formStyle = {
    margin: "0 auto",
    padding: "20px",
    border: "1px solid #ddd",
    borderRadius: "4px",
    maxWidth: "60%",
    marginTop: "30px",
    backgroundColor: "#f9f9f9",
  };





  return (
    <div>

      <h4 className="Events_CreateEvents_heading1">Add Services</h4>
        <Formik
        initialValues={{ name: "", email: "" }}
        onSubmit={async (values) => {
          await new Promise((resolve) => setTimeout(resolve, 500));
          alert(JSON.stringify(values, null, 2));
        }}
      >
        <Form style={{margin:'8%'}}>
          <Row>
            <label labelStyle > Service Name:  </label>
            <Field name="name" type="text" />
          </Row>
          <Row>

          </Row>
          <button type="submit">Submit</button>
        </Form>
      </Formik>
    </div>
  )
}

export default Add_services
